  "value": "\n  កម្មវិធីជំនួយនៅក្នុងឃ្លាំង umijs/plugins ពីមុនត្រូវបានសរសេរឡើងវិញ ធ្វើឱ្យប្រសើរឡើង និងបញ្ចូលទៅក្នុងឃ្លាំងមេ។ នេះត្រូវបានធ្វើសម្រាប់ការរចនាកម្រិតកំពូលកាន់តែប្រសើរ និងដើម្បីធ្វើឱ្យរចនាប័ទ្មនៃកម្មវិធីជំនួយផ្លូវការកាន់តែស៊ីសង្វាក់គ្នា។\n",
