var page_tabtype_meta_texts = [{
  "value": "dumi 支持组件页面的 Tab 自定义，分为以下两种方式",
  "paraId": 0,
  "tocIndex": 0
}, {
  "value": ".\n├── src\n│   ├── Foo\n│   │   ├── index.md\n│   │   └── index.$tab-api.md  # Tab 内容\n",
  "paraId": 1
}, {
  "value": "约定式就是不用手写配置，通过判断 md 文件命名是否带有 ",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "$tab-",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": " ，此文件将作为 Tab 的内容部分，如上所示，",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "index.$tab-api.md",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": " 会作为 ",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "index.md",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": " 的 Tab 呈现。此处 ",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "api",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": " 作为 Tab 的 key 值，如果需要配置 Tab 标题，可以使用 FrontMatter 来定义。",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "为了便于插件对 Tab 进行统一扩展，dumi 还提供了插件 API : ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "addContentTab",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": " ，我们可以使用它为指定路由添加 Tab。",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "// plugin.ts\nimport { IApi } from 'dumi';\n\nexport default (api: IApi) => {\n  api.addContentTab(() => ({\n    key: 'test',\n    component: require.resolve('./a.tsx'),\n    test: '/^/components//',\n  }));\n};\n",
  "paraId": 1
}, {
  "value": "component",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": " 放入我们自定义的 Tab 内容，",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "test",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": " 可以写入正则来匹配路由，这样我们就实现了为 ",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "/componets",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": " 下的路由页面添加自定义 Tab。",
  "paraId": 4,
  "tocIndex": 2
}];
